import Header from "../Component/Header";
const Home = () => {
  return (
    <>
      <Header />
      <div>
        <h2>Featured Products</h2>
        <p>
          Check out our handpicked selection of featured products, showcasing the best and most popular items in our inventory. Whether you're looking for a powerful new laptop, a sleek smartphone upgrade, or innovative smart home solutions, you'll find it all here.
        </p>
        <h2>Exclusive Deals and Offers</h2>
        <p>
          Don't miss out on our exclusive deals and offers! Enjoy limited-time discounts, bundle deals, and special promotions on a wide range of products. Shop smart and save big on your favorite electronics.
        </p>
      </div>
    </>
  );
};

export default Home;
